import React from "react";

const InputField = ({ type, name, classes, event }) => {
  console.log(event);
  console.log(type);
  console.log(name);
  console.log(classes);

  return (
    <div className="row">
      <input type={type} name={name} id={name} className={classes} />
    </div>
  );
};

export default InputField;
